import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Note from './Note';
import notesData from '../notes'
// console.log(notesData); 

function createNotes(cardData){
    return(
        < Note title= {cardData.title} content = {cardData.content }/> 
        )
}
function App() {
    return( 
        <div > 
            < Header />
            <Footer />
            {notesData.map(createNotes)}
            {/* < Note title= "Delegation" content = "Q. How many programmers does it take to change a light bulb? A. None – It’s a hardware problem" />  */}
        </div>
    );
}

export default App;
